import React from 'react';
import './css/App.css';

interface Props {
    logo: string,
    text: string, 
}

// const defaultProps: Props = {
//     logo: 'Mr',
//     text: 'McGee'
// }

const Header: React.SFC<Props> = ({ logo, text})  => (
    <div>
        <div>{logo}</div>
        <div>{text}</div>
    </div>
);

// Header.defaultProps = defaultProps;

export default Header;
